import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faT, faTruckBolt } from "@fortawesome/free-solid-svg-icons";

function MainSlide() {
  return (
    <div className="main-slide">
      <div>
        <h1>Project Zeus</h1>
        <h3>Find the best supplement for you</h3>
        <button>Browse Here</button>
      </div>
      <div className="main-slide-features">
        <FontAwesomeIcon icon={faTruckBolt} />
      </div>
    </div>
  );
}

export default MainSlide;
